import { Facebook, Instagram, Twitter } from "@material-ui/icons";
import styled from "styled-components"

const Container = styled.div`
    display: flex;
`;

const Left = styled.div`
    flex: 1;
    display: flex;
    flex-direction: column;
    padding: 20px;
`;

const Logo = styled.h1``;

const Desc = styled.p`
    margin: 20px 0px;
`;

const SocialContainer = styled.div`
    display: flex;
`;

const SocialIcon = styled.div`
    width: 40px;
    height: 40px;
    border-radius: 50%;
    color: white;
    background-color: #${props=>props.color};
    display: flex;
    align-items: center;
    justify-content: center;
    margin-right: 20px;
`;


const Center = styled.div`
    flex: 1;
    padding: 20px;
`;

const Title = styled.h3`
    margin-bottom: 30px;
`;

const List = styled.ul`
    margin: 0;
    padding: 0;
    list-style: none;
    display: flex;
    flex-wrap: wrap;
`;

const ListItem = styled.li`
    width: 50%;
    margin-bottom: 10px;
`;

const Right = styled.div`
    flex: 1;
    adding: 20px;
`;

const Footer = () => {
  return (
    <Container>
      <Left>
          <Logo>LITTLE BEACH</Logo>
          <Desc>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Sapiente modi ex amet voluptates esse illo maiores dolore facilis inventore, corporis sed eveniet praesentium facere cumque impedit eos temporibus? Delectus, iure.
          </Desc>
          <SocialContainer>
              <SocialIcon color="3B5999">
                  <Facebook/>
              </SocialIcon>
              <SocialIcon color="BC2A8D">
                  <Instagram/>
              </SocialIcon>
              <SocialIcon color="55ACEE">
                  <Twitter/>
              </SocialIcon>
          </SocialContainer>
      </Left>
      <Center>

        <Title>Useful Links</Title>
        <List>
            <ListItem>Home</ListItem>
            <ListItem>Cart</ListItem>
            <ListItem>Swimwear & Swimsuits</ListItem>
            <ListItem>Dresses</ListItem>
            <ListItem>Accessories</ListItem>
            <ListItem>My Account</ListItem>
            <ListItem>Order Tracking</ListItem>
            <ListItem>Wishlist</ListItem>
            <ListItem>Terms</ListItem>
            <ListItem>Terms</ListItem>
        </List>
      </Center>
      <Right></Right>
    </Container>
  )
}

export default Footer
